const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);
const token = await getToken(messaging, {
  vapidKey:
    "BC5frPVyX5VqaUU-pwEbevfYjqBMymWollYD1ImZ4BTPbqsFnyN64dLCqwLAWtYjQ7b2DVS5yGLbVelgEIfdDyU",
});

